import * as React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Collapse from '@mui/material/Collapse';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import DeleteIcon from '@mui/icons-material/Delete';
import { TransitionGroup } from 'react-transition-group';
import { Paper } from '@mui/material';
//import { useState , useEffect } from 'react';
import {  Typography } from '@mui/material';
import LooksOneIcon from '@mui/icons-material/LooksOne';



const FRUITS = [

  
  '🍌 Banana',
  '🍍 Pineapple',
  '🥥 Coconut',
  '🍉 Watermelon',
  
];

const paper =[

  <Paper 
  
  className='paper1'
     sx={{
      borderBottom: 1 ,
      borderBlockColor:"orange",
       position:"relative",
       width:"940px",
       display:"flex",
       justifyContent:"space-between",
       mt:"1px",
       mb:"10px",
       pt:"15px",
       pb:"7px",
       //width: {xs:"340px",sm:"340px",md:"340px"},
       mr:{xs:"200px"},
       ml:{sm:"200px"}
     }}
     style={{backgroundColor:"grey"}}
    >
     
     <Typography sx={{ml:"16px" , fontSize:"1.3em"}} variant='h6'>
     <IconButton style={{backgroundColor:"red" , color:"white"}}> <DeleteIcon/></IconButton>
     <Button variant="contained" disableElevation sx={{ ml:"10px"}} style={{backgroundColor:"white" , color:"orange"}}>إظهار    
     
     </Button>
      <Button variant="contained" disableElevation style={{backgroundColor:"orange" , color:"white"}} sx={{ ml:"10px"}}>
 تعديل   
  </Button>
      </Typography>
 
     <Typography
      sx={{
       mr:"35px", 
       fontSize:"1.4em",
       fontWeight:"500",
       }}
       style={{color:"black"}}
        variant='h6'>الحصه الاولي </Typography>
 
 <IconButton 
       sx={{position:"absolute"  , right:"0" }}
       >
         <LooksOneIcon  />
 
       </IconButton>
     </Paper>
,


]



function renderItem({ item, handleRemoveFruit }) {

  return (


    <ListItem
   
    >
          <ListItemText primary={item} sx={{pb:2, border:"4px soild red"}} />
          <IconButton
          edge="end"
          aria-label="delete"
          title="Delete"
          onClick={() => handleRemoveFruit(item)}
        >
          <DeleteIcon />
        </IconButton>

    </ListItem>


  );
}

export default function TransitionGroupExample() {

  const [fruitsInBasket, setFruitsInBasket] = React.useState(paper.slice(0,3));

  const handleAddFruit = () => {
    const nextHiddenItem = FRUITS.find((i) => !fruitsInBasket.includes(i));
    if (nextHiddenItem) {
      setFruitsInBasket((prev) => [ ...prev,nextHiddenItem]);
    }
  };

  const handleRemoveFruit = (item) => {
    setFruitsInBasket((prev) => [...prev.filter((i) => i !==item )]);
  };

  const addFruitButton = (

    <Button
      variant="contained"
      disabled={fruitsInBasket.length >= paper.length}
      onClick={handleAddFruit}
      sx={{ml:130 , mb:2}} 
      style={{backgroundColor:"orange" , color:"white"}}
     
   >
أضف حصه   

 </Button>
  );

  return (
    <div>
      {addFruitButton}
      <Box sx={{ mt: 1 }}>
   <Paper>
        <List>
          <TransitionGroup>

            {fruitsInBasket.map((item) => (
              <Collapse key={item}>
                {renderItem({ item, handleRemoveFruit })}
              </Collapse>
              
            ))}
          </TransitionGroup>
        </List>
        </Paper>
      </Box>
    </div>
  );
}
